    playbackData.comments = {"d8d5b9bd-9950-4b40-a9cd-8f9588b569de":[{"id":"9eb983b7-a9e3-448e-af43-fa3108aa6ffa","displayCommentEventId":"d8d5b9bd-9950-4b40-a9cd-8f9588b569de","displayCommentEventSequenceNumber":0,"developerGroupId":"8d62484f-7127-47f7-a3e5-84e938276423","timestamp":1693173078712,"commentText":"<div>A class constructor is used to initialize the private data members of a class. Constructor methods are called automatically and usually take parameters to initialize an object. Sometimes, though, we want to create an object based on an existing object of the same type. This program shows how a copy constructor does that in C++.</div><div><br></div><div>In this program I will create a class called <span style=\"font-family: Courier;\">ArtWork</span> which represents a piece of art. I want to store the title and author of each piece of art and I want to make sure I track original art versus copies of existing artwork.</div><div><br></div><div>I'll use a copy constructor to mark where copies come from.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"20a97d58-0aef-49a0-b0aa-b060e5688de1":[{"id":"dc7e2cb5-6322-4a05-b417-95cb6c73911f","displayCommentEventId":"20a97d58-0aef-49a0-b0aa-b060e5688de1","displayCommentEventSequenceNumber":119,"developerGroupId":"e9c3454f-f6ff-4c72-a1ae-fbfe2d17480c","timestamp":1693173576560,"commentText":"Here is my skeleton <span style=\"font-family: Courier;\">main</span>. The attached screenshot shows the output.","commentTitle":"","position":0,"selectedCodeBlocks":[{"fileId":"aa013bc4-9ac3-4fa7-a904-619fdcf57702","selectedText":"cout<<\"Copy Constructor Test\"<<endl<<endl;","startRow":6,"startColumn":4,"endRow":6,"endColumn":46}],"imageURLs":["media/images/1693173563312-Screen-Shot-2023-08-27-at-4.24.30-PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":6,"linesBelow":2,"currentFilePath":"/main.cpp","viewableBlogText":"#include <iostream>\n\nusing namespace std;\n\nint main()\n{\n    cout<<\"Copy Constructor Test\"<<endl<<endl;\n    return 0;\n}","commentTags":["image"],"questionCommentData":null}],"cd0da624-f5db-41ae-b55c-7cbe730ab1a1":[{"id":"8218b894-18a3-4a97-a61d-d6e9402a2f26","displayCommentEventId":"cd0da624-f5db-41ae-b55c-7cbe730ab1a1","displayCommentEventSequenceNumber":351,"developerGroupId":"e9c3454f-f6ff-4c72-a1ae-fbfe2d17480c","timestamp":1693173621808,"commentText":"<div>This is a class that represents a piece of art.</div>","commentTitle":"ArtWork Class","position":0,"selectedCodeBlocks":[{"fileId":"27d0c8b4-8cf9-4c0a-9430-bf59c67417c4","selectedText":"ArtWork","startRow":5,"startColumn":6,"endRow":5,"endColumn":13}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":9,"currentFilePath":"/ArtWork.h","viewableBlogText":"class ArtWork\n{\npublic:\n    ArtWork(string t, string an);\n    void print();\nprivate:\n    string title;\n    string artistName;\n    string type; //original or some kind of copy\n};","commentTags":[],"questionCommentData":null},{"id":"34808dd7-d850-4c89-b6e3-00e4d7971962","displayCommentEventId":"cd0da624-f5db-41ae-b55c-7cbe730ab1a1","displayCommentEventSequenceNumber":351,"developerGroupId":"e9c3454f-f6ff-4c72-a1ae-fbfe2d17480c","timestamp":1693173663798,"commentText":"<div>The private data members describe the piece of art.&nbsp;</div><div><br></div><div>The type of an artwork is either 'Original Art' or a copy of an existing piece of art. I want to make sure that all copies are marked as such. I'll do that in a bit, but first let me finish the basic class.</div>","commentTitle":"","position":1,"selectedCodeBlocks":[{"fileId":"27d0c8b4-8cf9-4c0a-9430-bf59c67417c4","selectedText":"string title;\n    string artistName;\n    string type;","startRow":11,"startColumn":4,"endRow":13,"endColumn":16}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":6,"linesBelow":1,"currentFilePath":"/ArtWork.h","viewableBlogText":"class ArtWork\n{\npublic:\n    ArtWork(string t, string an);\n    void print();\nprivate:\n    string title;\n    string artistName;\n    string type; //original or some kind of copy\n};","commentTags":[],"questionCommentData":null},{"id":"b735932b-7da6-4743-a4f6-0b45e2cac460","displayCommentEventId":"cd0da624-f5db-41ae-b55c-7cbe730ab1a1","displayCommentEventSequenceNumber":351,"developerGroupId":"e9c3454f-f6ff-4c72-a1ae-fbfe2d17480c","timestamp":1693173693623,"commentText":"<div>This is a constructor that is used to initialize the instance variables of the class. You will see shortly that it is pretty straightforward.<br></div>","commentTitle":"","position":2,"selectedCodeBlocks":[{"fileId":"27d0c8b4-8cf9-4c0a-9430-bf59c67417c4","selectedText":"ArtWork(string t, string an);","startRow":8,"startColumn":4,"endRow":8,"endColumn":33}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":3,"linesBelow":6,"currentFilePath":"/ArtWork.h","viewableBlogText":"class ArtWork\n{\npublic:\n    ArtWork(string t, string an);\n    void print();\nprivate:\n    string title;\n    string artistName;\n    string type; //original or some kind of copy\n};","commentTags":[],"questionCommentData":null},{"id":"d865ff50-d258-408d-b55a-9ea58bbab6f4","displayCommentEventId":"cd0da624-f5db-41ae-b55c-7cbe730ab1a1","displayCommentEventSequenceNumber":351,"developerGroupId":"e9c3454f-f6ff-4c72-a1ae-fbfe2d17480c","timestamp":1693173721197,"commentText":"Finally, I add a <span style=\"font-family: Courier;\">print</span> method that will print the basic info about the piece of art.","commentTitle":"","position":3,"selectedCodeBlocks":[{"fileId":"27d0c8b4-8cf9-4c0a-9430-bf59c67417c4","selectedText":"void print();","startRow":9,"startColumn":4,"endRow":9,"endColumn":17}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":4,"linesBelow":5,"currentFilePath":"/ArtWork.h","viewableBlogText":"class ArtWork\n{\npublic:\n    ArtWork(string t, string an);\n    void print();\nprivate:\n    string title;\n    string artistName;\n    string type; //original or some kind of copy\n};","commentTags":[],"questionCommentData":null}],"488c1025-0653-4979-a647-c45065c1692a":[{"id":"8cd2630f-396c-4b94-8d95-8e7e4e080d97","displayCommentEventId":"488c1025-0653-4979-a647-c45065c1692a","displayCommentEventSequenceNumber":891,"developerGroupId":"e9c3454f-f6ff-4c72-a1ae-fbfe2d17480c","timestamp":1693173781152,"commentText":"As promised, here is the constructor that initializes the private data.","commentTitle":"","position":0,"selectedCodeBlocks":[{"fileId":"bbc1fc3b-b736-4698-a757-41f093dc5c04","selectedText":"ArtWork::ArtWork(string t, string an)\n{\n    title = t;\n    artistName = an;\n    type = \"Original Art\";\n}","startRow":7,"startColumn":0,"endRow":12,"endColumn":1}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/ArtWork.cpp","viewableBlogText":"ArtWork::ArtWork(string t, string an)\n{\n    title = t;\n    artistName = an;\n    type = \"Original Art\";\n}","commentTags":[],"questionCommentData":null},{"id":"a377ae8f-c4c1-44c1-a643-372dabe574b3","displayCommentEventId":"488c1025-0653-4979-a647-c45065c1692a","displayCommentEventSequenceNumber":891,"developerGroupId":"e9c3454f-f6ff-4c72-a1ae-fbfe2d17480c","timestamp":1693173812035,"commentText":"<div>And this is a method that will print it.<br></div>","commentTitle":"","position":1,"selectedCodeBlocks":[{"fileId":"bbc1fc3b-b736-4698-a757-41f093dc5c04","selectedText":"void ArtWork::print()\n{\n    cout<<\"Title: \"<<title<<endl;\n    cout<<\"Artist: \"<<artistName<<endl;\n    cout<<\"Type of work: \"<<type<<endl;\n}","startRow":14,"startColumn":0,"endRow":19,"endColumn":1}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/ArtWork.cpp","viewableBlogText":"void ArtWork::print()\n{\n    cout<<\"Title: \"<<title<<endl;\n    cout<<\"Artist: \"<<artistName<<endl;\n    cout<<\"Type of work: \"<<type<<endl;\n}","commentTags":[],"questionCommentData":null},{"id":"c10472b4-b355-4855-b4e5-aa590e3a0846","displayCommentEventId":"488c1025-0653-4979-a647-c45065c1692a","displayCommentEventSequenceNumber":891,"developerGroupId":"e9c3454f-f6ff-4c72-a1ae-fbfe2d17480c","timestamp":1693174298851,"commentText":"In <span style=\"font-family: Courier;\">main</span>, I use the constructor to create a few new objects.","commentTitle":"","position":2,"selectedCodeBlocks":[{"fileId":"aa013bc4-9ac3-4fa7-a904-619fdcf57702","selectedText":"ArtWork piece1(\"Mona Lisa\", \"Leo DV\");\n    ArtWork piece2(\"David\", \"Michelangelo\");","startRow":9,"startColumn":4,"endRow":10,"endColumn":44}],"imageURLs":["media/images/1693174206673-IMG_C87A47372CAD-1.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":4,"linesBelow":8,"currentFilePath":"/main.cpp","viewableBlogText":"int main()\n{\n    cout<<\"Copy Constructor Test\"<<endl<<endl;\n\n    ArtWork piece1(\"Mona Lisa\", \"Leo DV\");\n    ArtWork piece2(\"David\", \"Michelangelo\");\n    \n    piece1.print();\n    cout<<endl;\n    piece2.print();\n    cout<<endl;\n\n    return 0;\n}","commentTags":["image"],"questionCommentData":null},{"id":"4481c81f-8a0a-41c6-8bc4-11723224cc30","displayCommentEventId":"488c1025-0653-4979-a647-c45065c1692a","displayCommentEventSequenceNumber":891,"developerGroupId":"e9c3454f-f6ff-4c72-a1ae-fbfe2d17480c","timestamp":1693174360098,"commentText":"Here I use the <span style=\"font-family: Courier;\">print</span> method to see what is inside each object.<div><br></div><div>The attached screenshot shows two original pieces of art.</div>","commentTitle":"","position":3,"selectedCodeBlocks":[{"fileId":"aa013bc4-9ac3-4fa7-a904-619fdcf57702","selectedText":"piece1.print();","startRow":12,"startColumn":4,"endRow":12,"endColumn":19},{"fileId":"aa013bc4-9ac3-4fa7-a904-619fdcf57702","selectedText":"piece2.print();","startRow":14,"startColumn":4,"endRow":14,"endColumn":19}],"imageURLs":["media/images/1693174352113-Screen-Shot-2023-08-27-at-4.55.38-PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":3,"linesBelow":1,"currentFilePath":"/main.cpp","viewableBlogText":"    ArtWork piece1(\"Mona Lisa\", \"Leo DV\");\n    ArtWork piece2(\"David\", \"Michelangelo\");\n    \n    piece1.print();\n    cout<<endl;\n    piece2.print();\n    cout<<endl;","commentTags":["image"],"questionCommentData":null},{"id":"25623757-447e-4be9-8766-d5570a5a43d5","displayCommentEventId":"488c1025-0653-4979-a647-c45065c1692a","displayCommentEventSequenceNumber":891,"developerGroupId":"e9c3454f-f6ff-4c72-a1ae-fbfe2d17480c","timestamp":1693174540073,"commentText":"Next, I'll work on a <span style=\"font-style: italic;\">Copy Constructor</span>. The purpose of a copy constructor is to make a new object from an existing one instead of passing in individual values as parameters.<div><br></div><div>All classes get a 'free' default copy constructor that simply copies all of the instance members.</div><div><br></div><div>Sometimes, though, we want to do more than that when copying. This is what a copy constructor is for.</div>","commentTitle":"Copy Constructor","position":4,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.cpp","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"0b3851f1-8a15-4047-aa58-33fef08b5669":[{"id":"92a35136-2bfe-4f07-849d-f78238926166","displayCommentEventId":"0b3851f1-8a15-4047-aa58-33fef08b5669","displayCommentEventSequenceNumber":927,"developerGroupId":"e9c3454f-f6ff-4c72-a1ae-fbfe2d17480c","timestamp":1693174604305,"commentText":"<div>A copy constructor, like all constructors, is a method with the same name as the class.</div><div><br></div><div>This is considered a <span style=\"font-style: italic;\">copy constructor</span> because the first parameter is also an <span style=\"font-family: Courier;\">ArtWork</span> object that is passed in by reference. All constructors with this type of signature are copy constructors.</div><div><br></div><div>Here I am calling the parameter, <span style=\"font-family: Courier;\">original</span>, because a new object is going to be made from it.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[{"fileId":"27d0c8b4-8cf9-4c0a-9430-bf59c67417c4","selectedText":"ArtWork(ArtWork& original);","startRow":9,"startColumn":4,"endRow":9,"endColumn":31}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":4,"linesBelow":6,"currentFilePath":"/ArtWork.h","viewableBlogText":"class ArtWork\n{\npublic:\n    ArtWork(string t, string an);\n    ArtWork(ArtWork& original);\n    void print();\nprivate:\n    string title;\n    string artistName;\n    string type; //original or some kind of copy\n};","commentTags":[],"questionCommentData":null}],"7a4d7289-69a8-4ae5-8df9-3cd4b01d6452":[{"id":"16d5c1eb-bfc0-4931-846a-996cfecb0589","displayCommentEventId":"7a4d7289-69a8-4ae5-8df9-3cd4b01d6452","displayCommentEventSequenceNumber":1167,"developerGroupId":"e9c3454f-f6ff-4c72-a1ae-fbfe2d17480c","timestamp":1693174660388,"commentText":"The first two lines of the copy constructor are simply copying the data directly from the original object passed in as a parameter to the newly created object.<div><br></div><div>You can tell this is the case because I am using the object, <span style=\"font-family: Courier;\">original</span>, along with a dot to access the private data members on the right hand side of the assignment statement.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[{"fileId":"bbc1fc3b-b736-4698-a757-41f093dc5c04","selectedText":"title = original.title;\n    artistName = original.artistName;","startRow":16,"startColumn":4,"endRow":17,"endColumn":37}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":2,"linesBelow":2,"currentFilePath":"/ArtWork.cpp","viewableBlogText":"ArtWork::ArtWork(ArtWork& original)\n{\n    title = original.title;\n    artistName = original.artistName;\n    type = \"Copy of \" + original.type;\n}","commentTags":[],"questionCommentData":null},{"id":"49cb382a-8ff8-49c6-af99-2e90d252adea","displayCommentEventId":"7a4d7289-69a8-4ae5-8df9-3cd4b01d6452","displayCommentEventSequenceNumber":1167,"developerGroupId":"e9c3454f-f6ff-4c72-a1ae-fbfe2d17480c","timestamp":1693174717167,"commentText":"<div>Line 19 is where it gets interesting. Since I know this is a copy and not a pure original piece of art I can add a bit of text to the original's type. This guarantees that copies are not mistaken for originals.</div><div><br></div><div>If the original has a <span style=\"font-family: Courier;\">type</span> with the value \"O<span style=\"font-family: Courier;\">riginal Art</span>\" then the copy will have a <span style=\"font-family: Courier;\">type</span> value of \"<span style=\"font-family: Courier;\">Copy of Original Art</span>\".</div>","commentTitle":"","position":1,"selectedCodeBlocks":[{"fileId":"bbc1fc3b-b736-4698-a757-41f093dc5c04","selectedText":"type = \"Copy of \" + original.type;","startRow":18,"startColumn":4,"endRow":18,"endColumn":38}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":4,"linesBelow":1,"currentFilePath":"/ArtWork.cpp","viewableBlogText":"ArtWork::ArtWork(ArtWork& original)\n{\n    title = original.title;\n    artistName = original.artistName;\n    type = \"Copy of \" + original.type;\n}","commentTags":[],"questionCommentData":null},{"id":"4ed15697-dfbc-4598-9b0a-acd49f1e3e54","displayCommentEventId":"7a4d7289-69a8-4ae5-8df9-3cd4b01d6452","displayCommentEventSequenceNumber":1167,"developerGroupId":"e9c3454f-f6ff-4c72-a1ae-fbfe2d17480c","timestamp":1693174977896,"commentText":"Back in <span style=\"font-family: Courier;\">main</span>, I create a new <span style=\"font-family: Courier;\">ArtWork</span> object from an existing one on line 18 by using the assignment operator in the declaration.<div><br></div><div>The compiler will automatically call the copy constructor when there is a data declaration on the left hand side of an assignment operator and an object of the same type on the right hand side.</div><div><br></div><div>Here, I copy two members and alter the third by adding \"<span style=\"font-family: Courier;\">Copy Of </span>\" to it.</div>","commentTitle":"","position":2,"selectedCodeBlocks":[{"fileId":"aa013bc4-9ac3-4fa7-a904-619fdcf57702","selectedText":"ArtWork copyOfMonaLisa = piece1;","startRow":17,"startColumn":4,"endRow":17,"endColumn":36}],"imageURLs":["media/images/1693175219508-image.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.cpp","viewableBlogText":"    ArtWork copyOfMonaLisa = piece1;","commentTags":["image"],"questionCommentData":null},{"id":"a216dd2b-a95c-46ae-a777-999575aeb0a4","displayCommentEventId":"7a4d7289-69a8-4ae5-8df9-3cd4b01d6452","displayCommentEventSequenceNumber":1167,"developerGroupId":"e9c3454f-f6ff-4c72-a1ae-fbfe2d17480c","timestamp":1693175012907,"commentText":"<div>Next, I print it. You can see from the attached screenshot that it is marked as a copy of an original.<br></div>","commentTitle":"","position":3,"selectedCodeBlocks":[{"fileId":"aa013bc4-9ac3-4fa7-a904-619fdcf57702","selectedText":"copyOfMonaLisa.print();","startRow":18,"startColumn":4,"endRow":18,"endColumn":27}],"imageURLs":["media/images/1693175010771-Screen-Shot-2023-08-27-at-4.57.23-PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":1,"linesBelow":0,"currentFilePath":"/main.cpp","viewableBlogText":"    ArtWork copyOfMonaLisa = piece1;\n    copyOfMonaLisa.print();","commentTags":["image"],"questionCommentData":null}],"f0432def-b7a2-470a-aa01-053b266cb275":[{"id":"63a8db67-3830-4342-bc27-b0ad16a71c72","displayCommentEventId":"f0432def-b7a2-470a-aa01-053b266cb275","displayCommentEventSequenceNumber":1277,"developerGroupId":"e9c3454f-f6ff-4c72-a1ae-fbfe2d17480c","timestamp":1693175396837,"commentText":"What happens if you make a copy of a copy? As you might expect the copy constructor gets called and a new object is created.<div><br></div><div>The attached screenshot shows the \"<span style=\"font-family: Courier;\">Copy of Copy of Original Art</span>\" output.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[{"fileId":"aa013bc4-9ac3-4fa7-a904-619fdcf57702","selectedText":"ArtWork copyOfCopyOfMonaLisa = copyOfMonaLisa;\n    copyOfCopyOfMonaLisa.print();","startRow":21,"startColumn":4,"endRow":22,"endColumn":33}],"imageURLs":["media/images/1693175387110-Screen-Shot-2023-08-27-at-4.58.07-PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":4,"linesBelow":1,"currentFilePath":"/main.cpp","viewableBlogText":"    ArtWork copyOfMonaLisa = piece1;\n    copyOfMonaLisa.print();\n    cout<<endl;\n\n    ArtWork copyOfCopyOfMonaLisa = copyOfMonaLisa;\n    copyOfCopyOfMonaLisa.print();\n    cout<<endl;","commentTags":["image"],"questionCommentData":null}],"b8266f1c-b222-4691-89c3-c4d3e9c90d86":[{"id":"d6641b70-0a08-4809-bd0b-be74ec2b9213","displayCommentEventId":"b8266f1c-b222-4691-89c3-c4d3e9c90d86","displayCommentEventSequenceNumber":1289,"developerGroupId":"e9c3454f-f6ff-4c72-a1ae-fbfe2d17480c","timestamp":1693175642658,"commentText":"The passed in object in a copy constructor must be passed in by reference. The compiler insists that copy constructors pass in the object by reference. You will get a syntax error without the <span style=\"font-family: Courier;\">&amp;</span>.<div><br></div><div>It almost always makes sense to use <span style=\"font-family: Courier;\">const</span> with this parameter since making a copy should not change the original object.</div><div><br></div><div>On line 10, the <span style=\"font-family: Courier;\">const</span> keyword prevents me from changing the original <span style=\"font-family: Courier;\">ArtWork</span>&nbsp;object (I make a corresponding change in the .cpp).</div>","commentTitle":"","position":0,"selectedCodeBlocks":[{"fileId":"27d0c8b4-8cf9-4c0a-9430-bf59c67417c4","selectedText":"const","startRow":9,"startColumn":12,"endRow":9,"endColumn":17}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/ArtWork.h","viewableBlogText":"    ArtWork(const ArtWork& original);","commentTags":[],"questionCommentData":null},{"id":"5a6a3093-dbaa-4b83-a8ec-062ba60453ea","displayCommentEventId":"b8266f1c-b222-4691-89c3-c4d3e9c90d86","displayCommentEventSequenceNumber":1289,"developerGroupId":"e9c3454f-f6ff-4c72-a1ae-fbfe2d17480c","timestamp":1693177662562,"commentText":"This example is somewhat contrived. The real value of copy constructors is when a class holds on to resources like memory that should not be shared among copies of objects. This is called <span style=\"font-style: italic;\">Deep Copying</span>.<div><br></div><div>A <span style=\"font-family: Courier;\">vector</span>, for example, holds on to a pointer that refers to a chunk of memory. The <span style=\"font-family: Courier;\">vector</span> class has its own copy constructor that will make a copy of the pointer.&nbsp;</div><div><br></div><div>In this case, we want the two <span style=\"font-family: Courier;\">vectors</span> (the original and the copy) to be completely independent of each other. In other words, we DON'T want the two pointers to point to the same chunk of memory. We want a 'deep copy' when we make a new <span style=\"font-family: Courier;\">vector</span> from an existing one.</div><div><br></div><div>The attached picture shows what a shallow copy and a deep copy would look like. Keep in mind, though, that the&nbsp;<span style=\"font-family: Courier;\">vector</span>&nbsp;class makes a deep copy not a shallow one.</div>","commentTitle":"","position":1,"selectedCodeBlocks":[],"imageURLs":["media/images/1693177329306-image.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/ArtWork.h","viewableBlogText":"","commentTags":["image"],"questionCommentData":null},{"id":"28e8c62d-a281-4f09-9c1f-3e0492348c64","displayCommentEventId":"b8266f1c-b222-4691-89c3-c4d3e9c90d86","displayCommentEventSequenceNumber":1289,"developerGroupId":"e9c3454f-f6ff-4c72-a1ae-fbfe2d17480c","timestamp":1693178027437,"commentText":"Copy constructors get called automatically when the compiler sees an assignment like this:<div><span style=\"font-family: Courier;\">ArtWork copyOfMonaLisa = piece1;</span></div><div><br></div><div>Or using initialization syntax like this:</div><div><span style=\"font-family: Courier;\">ArtWork copyOfMonaLisa(piece1);</span><br></div><div><br></div><div>But also when an object is passed in to a method by value:</div><div><span style=\"font-family: Courier;\">void SomeClass::foo(ArtWork art)</span></div><div><span style=\"font-family: Courier;\">{</span></div><div><span style=\"font-family: Courier;\">&nbsp; &nbsp; //copy constructor is used to build this parameter</span></div><div><br></div><div>and when an object is returned from a method:</div><div><span style=\"font-family: Courier;\">void SomeClass::bar()</span></div><div><span style=\"font-family: Courier;\">{</span></div><div><span style=\"font-family: Courier;\">&nbsp; &nbsp; ArtWork local(\"David\", \"Michelangelo\");</span></div><div><span style=\"font-family: Courier;\">&nbsp; &nbsp; ...</span></div><div><span style=\"font-family: Courier;\">&nbsp; &nbsp; ...</span></div><div><span style=\"font-family: Courier;\"><br></span></div><div><span style=\"font-family: Courier;\">&nbsp; &nbsp; //this is 'going away' because it is a local variable</span></div><div><span style=\"font-family: Courier;\">&nbsp; &nbsp; //the copy constructor is used to create the return value</span></div><div><span style=\"font-family: Courier;\">&nbsp; &nbsp; return local;</span></div><div><span style=\"font-family: Courier;\">}</span></div><div><br></div>","commentTitle":"","position":2,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/ArtWork.h","viewableBlogText":"","commentTags":[],"questionCommentData":null}]};
